svg.script:
function init(evt) { if ( window.svgDocument == null ) svgDocument = evt.target.ownerDocument; }
function fmtT(val, div) {
if (div > 10000) return Math.floor(val*div/25/1000) + " ms";
if (div > 250) return Math.floor(val*div/25)/1000 + " ms";
return Math.floor(val*div*1000/25)/1000 + " us";
}
function fmtU(val, div, shift) { return Math.floor((shift-val)*div/25) + " mV"; }
function msMove (evt)
{
var x = evt.pageX;
var y = evt.clientY;
if (x < 0 || y < 0 || x >= 1024|| y >= 200)
return;
var hscroll = (document.all ? document.scrollLeft : window.pageXOffset);
var width = window.innerWidth;

svgDocument.getElementById("CH1").setAttribute("x", hscroll+20);
svgDocument.getElementById("CH2").setAttribute("x", hscroll+20);
svgDocument.getElementById("CH1s").setAttribute("x", hscroll+width-20);
svgDocument.getElementById("CH2s").setAttribute("x", hscroll+width-20);

svgDocument.getElementById("CH1").firstChild.data = "CH1: "+fmtU(y, 1000,   99) + " " + fmtT(x, 1);
svgDocument.getElementById("CH2").firstChild.data = "CH2: "+fmtU(y, 1000,   99) + " " + fmtT(x, 1);
}
